import React, { useState } from 'react';
import { Text, View, FlatList, Image, TextInput, Pressable, Modal } from 'react-native';
import ChatItem from './ChatItem';
import { Ionicons } from '@expo/vector-icons';
import { useNavigation } from '@react-navigation/native';

function Chat({navigation}) {

  const [isModalVisible, setModalVisible] = useState(false)


  const showModal = () => {
    setModalVisible(true);
  }

  const hideModal = () => {
    setModalVisible(false);
  };

  navigation.setOptions({
    headerRight: () => (
      <View style={{ flexDirection: 'row' }}>
        <Pressable onPress={() => { navigation.navigate('Message') }}>
          <Ionicons name="qr-code" size={24} color="white" style={{ padding: 5, paddingStart: 15 }} />
        </Pressable>
        <Pressable onPress={showModal}>
          <Ionicons name="add" size={24} color="white" style={{ padding: 5 }} />
        </Pressable>
      </View>
    ),
    headerTitle: () => (
      <View style={{ flexDirection: 'row', alignItems: 'center' }}>
        <Ionicons name="search" size={24} color="white" style={{ position: 'absolute', marginLeft: 10 }} />
        <TextInput onFocus={() => { navigation.navigate("TimKiem") }} style={{ flex: 1, height: 45, width: 300, paddingLeft: 40, borderRadius: 10, color: 'white' }} placeholder='Tìm kiếm' placeholderTextColor={'white'} />
      </View>
    ),
    headerStyle: {
      backgroundColor: "#0091FF",
      shadowColor: "#fff",
    },
    headerTintColor: "#fff",
    headerTitleStyle: {
      fontWeight: "bold",
      fontSize: 20,
    },
  });
  // Mảng dữ liệu mẫu
  const [users, setUsers] = useState([
    {
      ten: 'Nguyen Van A',
      url: 'https://randomuser.me/api/portraits/men/68.jpg',
      tinNhan: 'Hello',
      soTNChuaDoc: 6,
      thoiGian: 2,
    },
    {
      ten: 'Luong thi Tho',
      url: 'https://randomuser.me/api/portraits/men/70.jpg',
      tinNhan: 'Khoe khong',
      soTNChuaDoc: 0,
      thoiGian: 6
    },
    {
      ten: 'Nguyen Van Teo',
      url: 'https://randomuser.me/api/portraits/men/80.jpg',
      tinNhan: 'An com chua',
      soTNChuaDoc: 0,
      thoiGian: 0
    },
    {
      ten: 'Le Van Ty',
      url: 'https://randomuser.me/api/portraits/men/90.jpg',
      tinNhan: 'Dang lam gi the',
      soTNChuaDoc: 5,
      thoiGian: 8
    },
    {
      ten: 'Huynh Quoc Hao',
      url: 'https://randomuser.me/api/portraits/men/10.jpg',
      tinNhan: 'may gio roi',
      soTNChuaDoc: 7,
      thoiGian: 0
    },
    {
      ten: 'Bui Tri Thuc',
      url: 'https://randomuser.me/api/portraits/men/20.jpg',
      tinNhan: 'lam bai tap chua',
      soTNChuaDoc: 3,
      thoiGian: 12
    },
    {
      ten: 'Thanh Tam',
      url: 'https://randomuser.me/api/portraits/men/53.jpg',
      tinNhan: 'lam bai tap chua',
      soTNChuaDoc: 0,
      thoiGian: 5
    },
    {
      ten: 'Hung Dung',
      url: 'https://randomuser.me/api/portraits/men/62.jpg',
      tinNhan: 'lam bai tap chua',
      soTNChuaDoc: 4,
      thoiGian: 0
    },
    {
      ten: 'Nam',
      url: 'https://randomuser.me/api/portraits/men/26.jpg',
      tinNhan: 'lam bai tap chua',
      soTNChuaDoc: 7,
      thoiGian: 2
    },
    {
      ten: 'Hau',
      url: 'https://randomuser.me/api/portraits/men/63.jpg',
      tinNhan: 'lam bai tap chua',
      soTNChuaDoc: 0,
      thoiGian: 3
    },
  ]);

  const handleChatItemPress = () => {
    // Chuyển đến trang Message
    navigation.navigate('Message');
  };

  return (
    <View style={{ flex: 1 }}>
      <FlatList
        data={users}
        renderItem={({ item }) => (
          <Pressable onPress={handleChatItemPress}>
            <ChatItem item={item} />
          </Pressable>
        )}
        keyExtractor={item => item.url}
      />
      <Modal
        animationType="none"
        transparent={true}
        visible={isModalVisible}
        onRequestClose={hideModal}
        
      >
        <Pressable style={{ flex: 1, justifyContent: 'flex-start', alignItems: 'flex-end' }} onPress={hideModal}>
          <View style={{ backgroundColor: 'white', padding: 10, borderRadius: 10 }}>
            <Pressable style={{ flexDirection: 'row', alignItems: 'center',padding:10 }}>
              <Ionicons name="person-add-outline" size={24} color="black" style={{ marginRight: 10 }} />
              <Text>Thêm bạn</Text>
            </Pressable>
            <Pressable style={{ flexDirection: 'row', alignItems: 'center',padding:10  }}>
              <Ionicons name="people-outline" size={24} color="black" style={{ marginRight: 10}} />
              <Text>Tạo nhóm</Text>
            </Pressable>
            <Pressable style={{ flexDirection: 'row', alignItems: 'center',padding:10  }}>
              <Ionicons name="cloud-outline" size={24} color="black" style={{ marginRight: 10 }} />
              <Text>Cloud của tôi</Text>
            </Pressable>
            <Pressable style={{ flexDirection: 'row', alignItems: 'center',padding:10  }}>
              <Ionicons name="calendar-outline" size={24} color="black" style={{ marginRight: 10}} />
              <Text>Lịch Zalo</Text>
            </Pressable>
            <Pressable style={{ flexDirection: 'row', alignItems: 'center',padding:10  }}>
              <Ionicons name="videocam-outline" size={24} color="black" style={{ marginRight: 10 }} />
              <Text>Tạo cuộc gọi nhóm</Text>
            </Pressable>
            <Pressable style={{ flexDirection: 'row', alignItems: 'center',padding:10 }}>
              <Ionicons name="desktop-outline" size={24} color="black" style={{ marginRight: 10}} />
              <Text>Thiết bị đăng nhập</Text>
            </Pressable>
          </View>
        </Pressable>
      </Modal>
    </View>
  );
}

export default Chat;
